import React from 'react'

const MyMessage = ({ messageData }) => {
    
    return (
        <div className='w-full flex items-center justify-end'>
            <div className='max-w-[80%] p-2 bg-green-500 rounded-lg flex flex-col space-y-1'>
                <p className='text-white font-bold text-2sm'>
                    {messageData.From}
                </p>
            </div>
        </div>
    )
}

export default MyMessage
